var tipuesearch = {"pages": [{'title': 'About', 'text': '成員:張昱棠(41023153)，王翔楷(41023113) \n 倉儲: https://github.com/mdecd2023/2a-pj1ag14 \xa0 \n 網站: https://mdecd2023.github.io/2a-pj1ag14 \xa0\xa0 \n', 'tags': '', 'url': 'About.html'}, {'title': 'w3', 'text': 'w3 - 2023.03.10.16 已經完成分組網頁者, 可以得到分組網頁評分 \n w3 - 請各組寫一個程式判定 2a 哪一組已經完成網頁建置. \n w3 開始執行 \xa0 https://mde.tw/pjcopsim/content/bubbleRobTutorial.html \n \n 課程內容:創建以及了解如何共同維護團隊的倉儲 \n 心得:在我們剛創建倉儲時不小心把倉儲Fork至我們個人的github倉儲下了，導致老師那邊的團隊倉儲連線不到我們更改的網站以及倉儲，再詢問老師時，老師以非常好理解的方式講解給我們理解，並讓我們理解了哪一步做錯了，老師也以引導的方式讓我們慢慢理解該如何解決，並告訴我們日後該如何與組員達到協同設計， \n \n', 'tags': '', 'url': 'w3.html'}, {'title': '張昱棠41023153心得', 'text': '張昱棠:由於上學期的usb隨身倉儲故障了，這學期用了一顆新的隨身碟，在一開始建立團隊倉儲acp時，發現新的隨身系統並未綁定github帳戶導致無法推送，綁定完後開始建立團隊的共同倉儲，發現我們共同倉儲由於不小心fork到我們的個人github下，導致無法連線至老師的團體倉儲後詢問老師問題，並且與組員及同學一起討論並且解決成功連線上。 \n \n \n', 'tags': '', 'url': '張昱棠41023153心得.html'}, {'title': '王翔楷41023113心得', 'text': '王翔楷:雖然先前在嚴老師的課上常常與同學共同討論課程內容 ，這是首次要跟同學合作，建立共同倉儲，雖然剛開始弄得不是很順利，但最後藉著詢問老師，並且與同學共同討論後成功連上 。 \n', 'tags': '', 'url': '王翔楷41023113心得.html'}, {'title': 'tutorial1', 'text': 'ag14 tutorial presentation \n \n \n \n \n bubbleRob本體 \n slider \n wheels \n \n \n \n \n \n \n', 'tags': '', 'url': 'tutorial1.html'}, {'title': '心得', 'text': '\n 張昱棠: \n 我們在製作過程中遇到了相當多的問題，光語言的部分我們就開了一個翻譯的網頁在旁邊一起配著原文版看，在一開始時，有點不太理解調整數值是必須輸入註解內的數值還是本文內的，導致數值有些輸入錯誤，在一連串的錯誤後，我們果斷選擇，直接開一個新檔案重做，由於當天我們留在學校做，大概從七點開始一路錯誤重來錯誤重來到快凌晨一點才回家，終於在隔天成功做出結果來了，在學習coppeliasim 的部分，接續上學期學到的在這學期應用，並且學習了許多新的知識 \n 王翔楷: \n 製作初期其實並不順利，我們這組和另外兩個同學一起從七點弄到凌晨一點才回家，過程中最難克服的是對軟體的不熟悉，隔天利用下午沒課的時間慢慢摸索，最後才順利完成建置，再利用晚上上課的時間向老師請教感測器內部程式的問題後回到座位上研究，最後才順利完成功課。 \n \n', 'tags': '', 'url': '心得.html'}]};